import React, { useState } from "react";
import AddStu from "./AddStu";
import Reg from "./Reg";
import TestSys from "./TestSys";
import { BrowserRouter, Routes, Route, Link, Switch } from "react-router-dom";

export const Nav2 = () => {
  return (
    <>
    <BrowserRouter>
      <nav class="navbar navbar-expand-lg bg-body-tertiary p-0">
        <div class="container-fluid  shadow">
          <div class="collapse navbar-collapse" id="navbarNav">
            <ul class="navbar-nav">
              <li class="nav-item">
                <Link class="nav-link active" aria-current="page" to='/Reg'>
                  Attendance
                </Link>
              </li>
              <li class="nav-item">
                <Link class="nav-link" to='/AddStu'>Add Student</Link>
              </li>
              <li class="nav-item">
                <Link class="nav-link" to='/TestSys'>Test System</Link>
              </li>
            </ul>
          </div>
        </div>
      </nav>
      <Switch>
        <Route exact path="/Reg" Component={Reg}/>
        <Route exact path="/AddStu" Component={AddStu}/>
        <Route exact path="/TestSys" Component={TestSys}/>
      </Switch>
      </BrowserRouter>
    </>
  );
};

export default Nav2;
